pub enum Body {

    /// Empty response. `Content-Length` header is not set.
    None,

    /// Zero sized response body. `Content-Length` header is set to `0`.
    Empty,

    /// Specific response body.
    Bytes(Bytes),

    /// Generic message body.
    Message(Pin<Box<MessageBody>>),
}

pub enum ResponseBody<B> {
    Body(
         #[pin]
         B),
    Other(Body),
}

pub enum BodySize {

    /// Absence of body can be assumed from method or status code.
    ///
    /// Will skip writing Content-Length header.
    None,

    /// Zero size body.
    ///
    /// Will write `Content-Length: 0` header.
    Empty,

    /// Known size body.
    ///
    /// Will write `Content-Length: N` header. `Sized(0)` is treated the same as `Empty`.
    Sized(u64),

    /// Unknown size body.
    ///
    /// Will not write Content-Length header. Can be used with chunked Transfer-Encoding.
    Stream,
}

pub enum Connection<A, B = Box<ConnectionIo>> where A: ConnectionIo,
         B: ConnectionIo {
    Tcp(ConnectionType<A>),
    Tls(ConnectionType<B>),
}

pub enum ConnectionType<Io: ConnectionIo> {
    H1(H1Connection<Io>),
    H2(H2Connection<Io>),
}

pub enum ConnectError {

    /// SSL feature is not enabled
    #[display(fmt = "SSL is not supported")]
    SslIsNotSupported,

    /// Failed to resolve the hostname
    #[display(fmt = "Failed resolving hostname: {}", _0)]
    Resolver(Box<std::error::Error>),

    /// No dns records
    #[display(fmt = "No DNS records found for the input")]
    NoRecords,

    /// Http2 error
    #[display(fmt = "{}", _0)]
    H2(h2::Error),

    /// Connecting took too long
    #[display(fmt = "Timeout while establishing connection")]
    Timeout,

    /// Connector has been disconnected
    #[display(fmt = "Internal error: connector has been disconnected")]
    Disconnected,

    /// Unresolved host name
    #[display(fmt =
              "Connector received `Connect` method with unresolved host")]
    Unresolved,

    /// Connection io error
    #[display(fmt = "{}", _0)]
    Io(io::Error),
}

pub enum SendRequestError {

    /// Invalid URL
    #[display(fmt = "Invalid URL: {}", _0)]
    Url(InvalidUrl),

    /// Failed to connect to host
    #[display(fmt = "Failed to connect to host: {}", _0)]
    Connect(ConnectError),

    /// Error sending request
    Send(io::Error),

    /// Error parsing response
    Response(ParseError),

    /// Http error
    #[display(fmt = "{}", _0)]
    Http(HttpError),

    /// Http2 error
    #[display(fmt = "{}", _0)]
    H2(h2::Error),

    /// Response took too long
    #[display(fmt = "Timeout while waiting for response")]
    Timeout,

    /// Tunnels are not supported for HTTP/2 connection
    #[display(fmt = "Tunnels are not supported for http2 connection")]
    TunnelNotSupported,

    /// Error sending request body
    Body(Error),
}

pub enum FreezeRequestError {

    /// Invalid URL
